import React, { Component } from 'react'

export default class Counter extends Component {
  constructor(){
    super();
    this.state={
        likes:0
    }

  }  

  incrementlikes(){
    this.setState({likes:this.state.likes+1})
  }

  render() {
    return (
        <div>
        <hr/>
        <button className='btn btn-secondary' on>Like</button>{this.state.likes}
        <hr/>
      </div>
    )
  }
}
